import React from "react";
import Header from "./header";
import Footer from "./footer";
import Note from "./Note";
import notes from "../notes";

function App(){
    return(
        <>
        <Header/>
        {notes.map(nodes => 
            <Note
                key={nodes.key}
                title={nodes.title}
                content={nodes.content}
            />
        )}
        <Footer/>
        </>
    );
}
export default App;
